import React from 'react';
import headerImg from '../../media/images/headerImg.jpeg'

const Header = (data) => {
    const thisInstance = data.props;
    console.log('instance');
    console.log(thisInstance);
    return (
        <div className="header-top">
            <img src={headerImg} alt="Houston Rockets" />
            <div className="game-detail">
                <h1>{thisInstance.away} @ {thisInstance.home}</h1>
                <h4>{thisInstance.city}, {thisInstance.state}</h4>
                <h4>{thisInstance.time} {thisInstance.date}</h4>
                <div className="header-resources">
                    <a className="" href="https://watch.nba.com/streaming-subscriptions?cid=nba%3Aleaguepass%3Ateam%3Adig%3Asite%3Awatch_upsell%3Aeg%3Atebou%3Asub%3At-gpm%3ARocketsGameTracker%3Au-glo%3Au-en%3A&_branch_match_id=817613803416432155&_branch_referrer=H4sIAAAAAAAAA8soKSkottLXTywo0MvJzMvWy0tK1EvOz9Uvyk%2FOTi0ptioqt0pPzE0tKUoE8osAE0C3Jy8AAAA%3D">
                        Watch Live
                    </a>
                    <a className="" href="https://www.nba.com/rockets/broadcast-information">
                        Streaming Information
                    </a>
                </div>
            </div>
        </div>
    )
}

export default Header;
